import React, { useState } from "react";
import { Link } from "react-router-dom";
import "../styles/Contact.css"; // ÿ™ÿ£ŸÉÿØ ŸÖŸÜ Ÿàÿ¨ŸàÿØ ŸÖŸÑŸÅ CSS

const Contact = () => {
  const [message, setMessage] = useState("");

  const handleSubmit = () => {
    if (!message.trim()) {
      alert("Please enter a message before sending.");
      return;
    }

    const phoneNumber = "01125700310"; 
    const encodedMessage = encodeURIComponent(message);
    const telegramUrl = `https://t.me/+${phoneNumber}?text=${encodedMessage}`;

    window.open(telegramUrl, "_blank"); 

    setMessage(""); 
  };

  return (
    <div className="contact-container">
      <h1>üìû Contact Us</h1>

      <div className="contact-info">
        <p>üìç <strong>Address:</strong> Trade Street, Riyadh</p>
        <p>üìß <strong>Email:</strong> support@shopwise.com</p>
        <p>üìû <strong>Phone:</strong> +966 920012345</p>
        <p>üïí <strong>Business Hours:</strong> 9:00 AM - 9:00 PM (Sat-Thu)</p>

        {/* Social Media Links */}
        <div className="social-links">
          <p>üåç <a href="#">Facebook</a> | üê¶ <a href="#">Twitter</a> | üì∑ <a href="#">Instagram</a></p>
        </div>
      </div>

      {/* Contact Form Section */}
      <div className="contact-form">
        <h2>üì© Send Us a Message</h2>
        <textarea
          placeholder="Write your message..."
          value={message}
          onChange={(e) => setMessage(e.target.value)}
        />
        <button onClick={handleSubmit}>Send</button>
      </div>

      {/* Interactive Map Section */}
      <div className="map-container">
        <h2>üìç Our Location</h2>
        <iframe
          title="Shopwise Location"
          src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d3624.556441307401!2d46.71370751500352!3d24.774265684097166!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x3e2f038f2d1d1f3b%3A0x75eab5bb30e528e3!2sRiyadh%20Trade%20Center!5e0!3m2!1sen!2ssa!4v1618293641234!5m2!1sen!2ssa"
          width="100%"
          height="300"
          allowFullScreen=""
          loading="lazy"
        ></iframe>
      </div>

      {/* Footer Section */}
      <footer className="footer">
        <div className="footer-container">
          {/* Store Information */}
          <div>
            <h2>üõçÔ∏è Shopwise</h2>
            <p>The best online store for high-quality products at great prices.</p>
          </div>

          {/* Quick Links */}
          <div>
            <h3>Quick Links</h3>
            <ul className="footer-links">
              <li><Link to="/">üè† Home</Link></li>
              <li><Link to="/categories">üìÇ Categories</Link></li>
              <li><Link to="/about">‚ÑπÔ∏è About Us</Link></li>
              <li><Link to="/contact">üìû Contact Us</Link></li>
            </ul>
          </div>

          {/* Contact Details */}
          <div>
            <h3>Get in Touch</h3>
            <p>üìç Address: Trade Street, Riyadh</p>
            <p>üìß Email: support@shopwise.com</p>
            <p>üìû Phone: +966 920012345</p>
            <div className="social-links">
              <a href="#">üåç Facebook</a>
              <a href="#">üê¶ Twitter</a>
              <a href="#">üì∑ Instagram</a>
            </div>
          </div>
        </div>

        {/* Copyright Notice */}
        <div className="footer-bottom">
          &copy; {new Date().getFullYear()} Shopwise. All rights reserved.
        </div>
      </footer>
    </div>
  );
};

export default Contact;
